import { makeStyles } from '@mui/styles';
export default makeStyles((theme) => ({
  mainContainer: {
    minWidth: '100%',
    minHeight: '90vh',
    height: '100%',
    [theme.breakpoints.down('sm')]: {
      minHeight: '35rem',
      minWidth: '24rem',
    },
  },
  tab:{
    minWidth:'33.3% !important'
  },
  typoTitle:{
      minWidth:'10rem',
      border:'1px solid grey',
      padding:10,
      borderRadius:10
  },
  accordionContainer:{
    minWidth:'20rem',
    padding:26,
    borderRadius:10,
    boxShadow:'1px 1px 3px 3px #D3D3D3'
  }
}));
